  \"2016-09-01T12:03:37.683117\",\n\t\"name\": \"potential-financial-impact\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The annual data tables contained in this
  document provide summary statistics on the civil enforcement activities of the United
  States Trustee Program.  This report covers potential financial impact. Financial
  Impact represents debt that potentially is not discharged in a bankruptcy case as
  a result of Program efforts. The measure also includes funds that become part of
  or remain in bankruptcy estates, funds that are returned to debtors, funds that
  are paid to the Treasury, and sanctions and fines as a result of Program efforts.\",\n\t\"license_title\":
